import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeStep, setActiveStep] = useState(0);
  const [showTooltip, setShowTooltip] = useState(null);

  const processingSteps = [
    { id: 'input', text: "Input Text", detail: "Raw text input for processing" },
    { id: 'tokenize', text: "Tokenization", detail: "Converting text into tokens" },
    { id: 'embed', text: "Embeddings", detail: "Token → Vector transformation" },
    { id: 'attention', text: "Self-Attention", detail: "Computing attention scores" },
    { id: 'process', text: "Processing", detail: "Through transformer layers" },
    { id: 'output', text: "Generation", detail: "Token probability distribution" }
  ];

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveStep(prev => (prev < processingSteps.length - 1 ? prev + 1 : 0));
    }, 2000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
    }}>
      {/* Main Processing Pipeline */}
      <div style={{
        position: 'relative',
        width: '500px',
        height: '400px',
        margin: '50px auto',
        backgroundColor: 'rgba(13, 14, 20, 0.95)',
        borderRadius: '24px',
        overflow: 'hidden',
        border: '1px solid rgba(147, 197, 253, 0.2)',
        boxShadow: '0 0 40px rgba(147, 197, 253, 0.15)',
        padding: '30px',
      }}>
        {/* Pipeline Steps */}
        <div style={{
          display: 'flex',
          flexDirection: 'column',
          gap: '20px',
          height: '100%',
        }}>
          {processingSteps.map((step, index) => (
            <div
              key={step.id}
              style={{
                display: 'flex',
                alignItems: 'center',
                gap: '15px',
                opacity: index <= activeStep ? 1 : 0.5,
                transition: 'all 0.3s ease',
              }}
              onMouseEnter={() => setShowTooltip(step.id)}
              onMouseLeave={() => setShowTooltip(null)}
            >
              {/* Step Number */}
              <div style={{
                width: '30px',
                height: '30px',
                borderRadius: '50%',
                backgroundColor: index <= activeStep ? 'rgba(147, 197, 253, 0.2)' : 'rgba(147, 197, 253, 0.1)',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                color: '#93C5FD',
                fontSize: '14px',
                fontWeight: 'bold',
              }}>
                {index + 1}
              </div>

              {/* Step Content */}
              <div style={{
                flex: 1,
                backgroundColor: index <= activeStep ? 'rgba(147, 197, 253, 0.1)' : 'rgba(147, 197, 253, 0.05)',
                padding: '15px',
                borderRadius: '12px',
                position: 'relative',
              }}>
                <div style={{
                  color: '#93C5FD',
                  fontSize: '16px',
                  fontWeight: 'bold',
                  marginBottom: '5px',
                }}>
                  {step.text}
                </div>
                <div style={{
                  color: '#FFFFFF',
                  fontSize: '14px',
                  opacity: 0.8,
                }}>
                  {step.detail}
                </div>

                {/* Processing Animation */}
                {index === activeStep && (
                  <div style={{
                    position: 'absolute',
                    bottom: 0,
                    left: 0,
                    height: '2px',
                    backgroundColor: '#93C5FD',
                    animation: 'progress 2s infinite linear',
                    width: '100%',
                  }} />
                )}

                {/* Technical Details Tooltip */}
                {showTooltip === step.id && (
                  <div style={{
                    position: 'absolute',
                    right: '-220px',
                    top: '50%',
                    transform: 'translateY(-50%)',
                    width: '200px',
                    backgroundColor: 'rgba(13, 14, 20, 0.95)',
                    border: '1px solid rgba(147, 197, 253, 0.2)',
                    borderRadius: '8px',
                    padding: '10px',
                    zIndex: 10,
                    animation: 'fadeIn 0.3s ease-out',
                  }}>
                    {getTechnicalDetail(step.id)}
                  </div>
                )}
              </div>
            </div>
          ))}
        </div>

        {/* Connection Lines */}
        <svg style={{
          position: 'absolute',
          top: 0,
          left: '45px',
          height: '100%',
          width: '2px',
          zIndex: 0,
        }}>
          <line
            x1="0"
            y1="0"
            x2="0"
            y2="100%"
            stroke="#93C5FD"
            strokeWidth="2"
            strokeDasharray="4"
            strokeOpacity="0.2"
          />
        </svg>
      </div>

      {/* Model Statistics */}
      <div style={{
        position: 'absolute',
        top: '20px',
        right: '20px',
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
      }}>
        {[
          { label: 'Parameters', value: '175B' },
          { label: 'Layers', value: '96' },
          { label: 'Context', value: '4K' },
        ].map((stat, index) => (
          <div
            key={index}
            style={{
              backgroundColor: 'rgba(147, 197, 253, 0.1)',
              padding: '8px 12px',
              borderRadius: '8px',
              display: 'flex',
              justifyContent: 'space-between',
              alignItems: 'center',
              width: '120px',
            }}
          >
            <span style={{ color: '#93C5FD', fontSize: '12px' }}>{stat.label}</span>
            <span style={{ color: '#FFFFFF', fontSize: '12px' }}>{stat.value}</span>
          </div>
        ))}
      </div>
    </div>
  );
}

// Technical details for tooltips
function getTechnicalDetail(stepId) {
  const details = {
    input: "Preprocessing: cleaning, normalization, and segmentation of raw text input.",
    tokenize: "BPE tokenization with vocabulary size of 50,257 tokens.",
    embed: "Position-aware token embeddings in 12,288-dimensional space.",
    attention: "Multi-head attention with 96 attention heads per layer.",
    process: "Decoder-only transformer architecture with 96 layers.",
    output: "Softmax distribution over vocabulary for next token prediction."
  };
  return details[stepId];
}

export default AIVisual;
